/* code block 4 */
import { Link } from 'react-router-dom';

const Navbar = () => {

    return(
        <header>
            <div className='container'>
                <nav>
                    <ul>
                        <li><a href="#login">Login</a></li>
                        <li><a href="#signup">SignUp</a></li>
                    </ul>
                </nav>

            </div>

        </header>
    )

}

export default Navbar;
